import './CenterPage.css';

export const CenterPage = () => {

    return <content>
        <video class="bg-video" src="https://www.norton.com.ar/wp-content/uploads/2018/01/norton-brand-1.mp4" 
        poster="https://www.norton.com.ar/wp-content/uploads/2018/01/bg-home-slide.jpg" 
        width="100%" height="100%" autoplay="" loop="" preload="auto"></video>
    </content>

}
